const Split1 = () =>{
    return (
            <div className="split1">
                <span></span>
                <p>Cliquez pour découvrir</p>
                <span></span>
            </div>
    );
};


const Menu_page_dev_item = () =>{
    return (
        <div className='menu_page_item'>
        <span></span>
        <p>Développement</p>
    </div>
    );

};

const Menu_page_son_item = () =>{
    return (
        <div className='menu_page_item'>
        <span></span>
        <p>Son</p>
    </div>
    );

};




const Menu_page = () =>{

    return (
        <div className="menu_page">
            <Split1/>
            <div className="carrousel">
                <Menu_page_dev_item/>
                <Menu_page_dev_item/>
                <Menu_page_dev_item/>
                <Menu_page_dev_item/>
            </div>
            <div className="carrousel">
                <Menu_page_dev_item/>
                <Menu_page_dev_item/>
                <Menu_page_dev_item/>
                <Menu_page_dev_item/>
            </div>
            <div className="carrousel">
                <Son/>
            </div>
            <Split1/>

        </div>
    );
};

export default Menu_page;
